import React from 'react';
import { Link } from 'react-router-dom';

function ColorList({ colors }){
    return(
        <div>
            <h1>Color List</h1>
            <link to="/colors/new">Add a color</link>
            {colors.map(color=>{
                return (
                    <div key={color}>
                        <Link to={`/colors/${color}`}>{color}</Link>
                    </div>
                );
            })}
        </div>
    );
}

export default ColorList;
